import React from 'react';
import { ReactComponent } from '*.svg';

class Sports extends React.Component{
    constructor(name,number,points){
        this.name = name;
        this.number = numer;
        this.points = points;
        this.test = "mytest";
    }

    print(){
        alert(this.name, this.points);
    }

    render(){
        return(
            <h1>{this.test}</h1>
        );
    }
}

export default Sports;
